import "./widgetSm.css";
import { Visibility } from "@material-ui/icons";
import { useEffect, useState } from "react";
import { userRequest } from "../../requestMethods";
export default function WidgetSm() {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const getUsers = async () => {
      try {
        const res = await userRequest.get("users/?new=true");
        setUsers(res.data);
      } catch {}
    };
    getUsers();
  }, []);
  return (
    <div className="widgetSm">
      <span className="widgetSmTitle">New Join Members</span>
      <ul className="widgetSmList">
        <li className="widgetSmListItem">
          <img
            src="https://img2.freepng.fr/20180204/fie/kisspng-scalable-vector-graphics-avatar-learning-icon-customer-login-avatar-5a77d3354ef990.2480330215178022933235.jpg"
            alt=""
            className="widgetSmImg"
          />
          <div className="widgetSmUser">
            <span className="widgetSmUsername">mehdi</span>
            <span className="widgetSmUserTitle">mehdi@gmail.com</span>
          </div>
          <button className="widgetSmButton">
            <Visibility className="widgetSmIcon" />
            Display
          </button>
        </li>
        <li className="widgetSmListItem">
          <img
              src="https://img2.freepng.fr/20180204/fie/kisspng-scalable-vector-graphics-avatar-learning-icon-customer-login-avatar-5a77d3354ef990.2480330215178022933235.jpg"
              alt=""
            className="widgetSmImg"
          />
          <div className="widgetSmUser">
            <span className="widgetSmUsername">maram</span>
            <span className="widgetSmUserTitle">maram@gmail.com</span>
          </div>
          <button className="widgetSmButton">
            <Visibility className="widgetSmIcon" />
            Display
          </button>
        </li>
        <li className="widgetSmListItem">
          <img
            src="https://img2.freepng.fr/20180204/fie/kisspng-scalable-vector-graphics-avatar-learning-icon-customer-login-avatar-5a77d3354ef990.2480330215178022933235.jpg"
            alt=""
            className="widgetSmImg"
          />
          <div className="widgetSmUser">
            <span className="widgetSmUsername">Ahmed salem</span>
            <span className="widgetSmUserTitle">ahmed_s@gmail.com</span>
          </div>
          <button className="widgetSmButton">
            <Visibility className="widgetSmIcon" />
            Display
          </button>
        </li>
        
      </ul>
    </div>
  );
}
